import React from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Chip,
  IconButton,
  Box,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import { Request } from '../services/storageService';
import RequestDialog from './RequestDialog';

interface EmployeeRequestsDialogProps {
  open: boolean;
  onClose: () => void;
  employeeId: string;
  requests: Request[];
  onSaveRequest: (request: Request) => void;
  onDeleteRequest: (request: Request) => void;
  employees: any[];
  nextRequestId: string;
}

const EmployeeRequestsDialog: React.FC<EmployeeRequestsDialogProps> = ({
  open,
  onClose,
  employeeId,
  requests,
  onSaveRequest,
  onDeleteRequest,
  employees,
  nextRequestId,
}) => {
  const [selectedRequest, setSelectedRequest] = React.useState<Request | undefined>();
  const [requestDialogOpen, setRequestDialogOpen] = React.useState(false);
  const [dialogMode, setDialogMode] = React.useState<'add' | 'edit'>('add');

  const employeeRequests = requests.filter(request => request.employeeId === employeeId);

  const handleAddClick = () => {
    setSelectedRequest(undefined);
    setDialogMode('add');
    setRequestDialogOpen(true);
  };

  const handleEditClick = (request: Request) => {
    setSelectedRequest(request);
    setDialogMode('edit');
    setRequestDialogOpen(true);
  };

  const handleDeleteClick = (request: Request) => {
    onDeleteRequest(request);
  };

  const handleRequestDialogClose = () => {
    setRequestDialogOpen(false);
    setSelectedRequest(undefined);
  };

  const formatItems = (items: Request['items']) => {
    return items.map(item => `${item.name} x ${item.quantity}`).join(', ');
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'Approved':
        return 'success';
      case 'Disapproved':
        return 'error';
      default:
        return 'warning';
    }
  };

  return (
    <>
      <Dialog open={open} onClose={onClose} maxWidth="lg" fullWidth>
        <DialogTitle>Employee Requests</DialogTitle>
        <DialogContent>
          <Box sx={{ mb: 2 }}>
            <Button
              variant="contained"
              color="primary"
              onClick={handleAddClick}
            >
              Add Request
            </Button>
          </Box>
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Type</TableCell>
                  <TableCell>Description</TableCell>
                  <TableCell>Request Date</TableCell>
                  <TableCell>Items</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {employeeRequests.map((request) => (
                  <TableRow key={request.id}>
                    <TableCell>{request.type}</TableCell>
                    <TableCell>{request.description}</TableCell>
                    <TableCell>{request.requestDate}</TableCell>
                    <TableCell>{formatItems(request.items)}</TableCell>
                    <TableCell>
                      <Chip
                        label={request.status}
                        color={getStatusColor(request.status)}
                      />
                    </TableCell>
                    <TableCell>
                      {request.status === 'Pending' && (
                        <Box>
                          <IconButton
                            size="small"
                            onClick={() => handleEditClick(request)}
                            color="primary"
                          >
                            <EditIcon />
                          </IconButton>
                          <IconButton
                            size="small"
                            onClick={() => handleDeleteClick(request)}
                            color="error"
                          >
                            <DeleteIcon />
                          </IconButton>
                        </Box>
                      )}
                    </TableCell>
                  </TableRow>
                ))}
                {employeeRequests.length === 0 && (
                  <TableRow>
                    <TableCell colSpan={6} align="center">
                      No requests found
                    </TableCell>
                  </TableRow>
                )}
              </TableBody>
            </Table>
          </TableContainer>
        </DialogContent>
        <DialogActions>
          <Button onClick={onClose}>Close</Button>
        </DialogActions>
      </Dialog>

      <RequestDialog
        open={requestDialogOpen}
        onClose={handleRequestDialogClose}
        onSave={onSaveRequest}
        request={selectedRequest}
        mode={dialogMode}
        employees={employees}
        nextRequestId={nextRequestId}
      />
    </>
  );
};

export default EmployeeRequestsDialog;
